import './App.css';
import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link, Redirect, Switch } from "react-router-dom";
import {FormControl,Button,Form,Nav,Navbar,Row,Card,Col} from 'react-bootstrap';
import './App.css';

import Authentification from './User/Authentification.js';
import Inscription from './User/Inscription.js';
import Menu from './User/Menu.js';

import Money_deposit from './Transaction/Money_deposit.js';
import Money_see from './Transaction/Money_see.js';
import Money_transit from './Transaction/Money_transit.js';
import Money_withdrawal from './Transaction/Money_withdrawal.js';

import Add_card from './Card/Add_card.js';
import Delete_card from './Card/Delete_card.js';
import Update_card from './Card/Update_card.js';



function App() {
  return (

    <Router>
    <div className="post_main">


    <div className="main">

    <Switch>

    <Route exact path="/login" component={ Login } />
    <Route exact path="/register" component={ Register } />

    <PrivateRoute exact path="/menu" component={Menu} />


    <PrivateRoute exact path="/opinions" component={Opinions} />
    <PrivateRoute exact path="/opinion/news" component={Opinion_News} />
    <PrivateRoute exact path="/opinion/edit/:id" component={Opinion_Edit} />

    <PrivateRoute exact path="/groups" component={Groups} />
    <PrivateRoute exact path="/group/news" component={Group_News} />
    <PrivateRoute exact path="/group/edit/:id" component={Group_Edit} />

    <PrivateRoute exact path="/places" component={Places} />
    <PrivateRoute exact path="/place/news" component={Place_News} />
    <PrivateRoute exact path="/place/edit/:id" component={Place_Edit} />

    <PrivateRoute exact path="/schools" component={Schools} />
    <PrivateRoute exact path='/school/edit/:id' component={ School_Edit } />
    <PrivateRoute exact path="/school/news" component={News} />

    <PrivateRoute exact path="/search/country/:name" component={Search_GrpCtry}/>
    <PrivateRoute exact path="/search/group/:name" component={Search_GrpCtry}/>
    <PrivateRoute exact path="/search/school/:name" component={Search_School}/>
    <PrivateRoute exact path="/search/place/:names/:school" component={Search_Place}/>
    <PrivateRoute exact path="/search/spot/:name" component={Search_Spot}/>
    <Route component={NoMatch} />

    </Switch>

    </div>



    </div>
    </Router>
  );
}

export default App;
